import React,{useEffect} from 'react'
import { connect } from 'react-redux';
import axios from 'axios'
import store from '../../Controllers/Store/store'
import * as actions from '../../Controllers/Actions/Actions'
import TopNav from './TopNav'

function Home(){
    useEffect(() => {
        document.title = "Home | Friend Finder";
        axios.post('http://localhost:4000/',localStorage.getItem(''))
    }, [])
    let name = "";
    try{
        name = store.getState().setName[0].name
    }
    catch(err){
        console.log(err.message);
        name = "loading.."
    }
    return(
        <div className="home">
            <TopNav name={name} />
            <div className="main-content">
                <div className="home-people-you-may-know">
                    <p>People you may know</p>
                </div>
            </div>
        </div>
    )
}

export default connect(
    null,
    { actions }
)(Home);
